@borg.on(admin_cmd(pattern=f"earth", outgoing=True))
async def _(event):
	if event.fwd_from:
		return
	deq = deque(list("üåèüåçüåéüåéüåçüåèüåçüåé"))
	for _ in range(48):
		await asyncio.sleep(0.1)
		await event.edit("".join(deq))
		deq.rotate(1)

